schemaDefinition: "create or replace view SN_TERRITORYMEMBERS(\n\t\"TerrMemberRoleName\"\
  ,\n\t\"TerrMemberUserSysID\",\n\t\"TerrMemberTerritoryName\",\n\t\"TerrMemberName\"\
  ,\n\t\"TerrMemberActive\",\n\t\"TerrMemberTerritorySysID\",\n\t\"TerrMemberUserName\"\
  \n) as -- SEMANTIC LAYER BEGINS\n\nSELECT \"SN_ROLENAME\" as \"TerrMemberRoleName\"\
  ,\n       \"SN_USER\" as \"TerrMemberUserSysID\",\n       \"SN_TERRITORYNAME\" as\
  \ \"TerrMemberTerritoryName\",\n       \"SN_USERNAME\" as \"TerrMemberName\",\n\
  \       \"SN_ACTIVE\" as \"TerrMemberActive\",\n       \"SN_TERRITORY\" as \"TerrMemberTerritorySysID\"\
  ,\n       LOWER(REPLACE(\"TerrMemberName\", 'random', 'random')) as \"TerrMemberUserName\"\
  \nFROM\n  (SELECT \"SN_ROLENAME\" as \"SN_ROLENAME\",\n          \"SN_USER\" as\
  \ \"SN_USER\",\n          \"SN_TERRITORYNAME\" as \"SN_TERRITORYNAME\",\n      \
  \    \"SN_USERNAME\" as \"SN_USERNAME\",\n          \"SN_ACTIVE\" as \"SN_ACTIVE\"\
  ,\n          \"SN_TERRITORY\" as \"SN_TERRITORY\"\n   FROM \"RDS\".\"DYNAMICS365\"\
  .\"SN_TERRITORYMEMBERS\"\n   WHERE \"SN_ACTIVE\" = 'random' )Projection_1;"
